import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom"
import { Home } from "./pages/Home/Home";
import { Products } from "./pages/Products/Products";
import { Product } from "./pages/Product/Product";

const router = createBrowserRouter([
  {
    path:"/",
    element:<Home/>
  },
  {
    path:"/products/:id",
    element:<Products/>
  },
  {
    path:"/product/:id",
    element:<Product/>
  },
  {
    path:"/blog/:id",
    element:<Blog/>
  },
])

function App() {
  return <div>
    <RouterProvider router={router}/>
  </div>;
}

export default App;
